import { Link } from "react-router-dom" ;
import "bootstrap/dist/css/bootstrap.min.css";

class User extends Component {
    constructor(props){
      super(props);

      this.state ={
        name:'',
        familyName:'',
        username:'',
        email:'',
        dob:'',
        location:'',
        password:'',
        motherName:'',
        fatherName:'',
        tags: ''
      }
    }

    onChangeUsername(e){
      this.setState({
        username: e.target.value
      });
    }


    render(){
        return(
          <div>
            <p>create user page</p>
          </div>
        );
    }
}

export default User;
